INSERT INTO `berita` (`id_berita`, `judul`, `isi`, `date`, `label`, `lihat`, `author`, `time`, `thumbnail`) VALUES
(12, 'Prestasi Guru SMKN 1 Sumedang Pada Lomba Guru Produktif SMK se- Ind', '<p>\n\nIbu Hali, Guru Teknik Komputer Jaringan lolos ke babak final masuk 50 besar dari 500 peserta se-Ind pada Lomba Guru Produktif SMK tingkat Nasional, dan Pa Wendiyana Cahyadian Guru Teknik Audio Video, berhasil menjadi JUARA III Tingkat Nasional pada Lomba Guru Produkrif SMK se- Ind yang diselenggarakan oleh Kemdidbud Jakarta di UNJ Jogjakarta. \n\n<br></p>', '2016-12-20', '9', 19, 'Admin', '07:02:05', 'assets/images/berita/3.jpg'),
(13, 'Lowongan Kerja di PT. Krakatau Semen Indonesia (PT KSI)', '<p>\r\n\r\n</p><p>PT. Krakatau Semen Indonesia (PT KSI) membuka lowongan pekerjaan dan mengundang kandidat yang memenuhi syarat-syarat untuk mengajukan lamaran&nbsp;</p><p>dengan persyaratan umum:</p><p>a. untuk SMK : Nilai Ijazah minimal 7.0(skala 10) , umur maksimal 23 tahun</p><p>b. Untuk D3 : nilai IPK minimal 3.00 (skala 4.0), umur maksimal 25 tahun</p><p>c. Untuk S1 :nilai IPK minimal 3.00 (skala 4.0), umur maksimal 26 tahun</p><p>d. untuk S2 :nilai IPK minimal 3.00 (skala 4.0), umur maksimal 30 tahun, Bahasa Inggris aktif (lisan dan korepodensi), pengalaman minimal 5 tahun</p><p>e. menguasai microsoft office</p><p>f. Berkelakuan Baik. (SKCK dibutuhkan saat wawancara)</p><p>g. Sehat Jasmani dan Rohani &nbsp;(tahapan tes kesehatan oleh panitia rekruitmen)</p><p>h. Kartu Pencari Kerja dari Disnaker (kartu Kuning)</p><p>&nbsp;</p><p>Pendaftaran aplikasi lamaran online dibuka pada 26-31 Oktober 2016 melalui website</p><p>&nbsp;</p><p><strong><a target="_blank" rel="nofollow" href="http://ft-pcdc.untirta.ac.id/">&nbsp;<strong>http://ft-pcdc.untirta.ac.id</strong></a></strong></p><p>&nbsp;</p><p>hanya pelamar yang memenuhi seluruh persyaratan dan mengisi form aplikasi online yang akan diproses ke tahap selanjutnya</p><p>kandidat yang lolos tahap seleksi administratip akan diumumkan melalui website PCDC PT. UNTIRTA pada tanggal 1 november 2016 untuk mengikuti tahapan seleksi</p><p>keputusan tim rekruitmen adalah mutlak dan tidak dapat diganggu gugat</p><p>proses rekruitmen dan seleksi ini tidak di pungut biaya</p>\r\n\r\n<br><p></p>', '2016-12-20', '10,11', 2, 'Admin', '07:04:02', 'assets/images/berita/4.JPG'),
(14, 'Lowongan Pekerjaan PT. Trans Retail Indonesia', '<p>\r\n\r\n</p><p>(TRANSMART-CARREFOUR) <br>1. Deputy Dept. Store(kode : DEPUTY) min 5 tahun di Dept.Store<br>2. Divisi Dept. Store (kode : DIVISI) min 4 tahun di Dept. Store<br>3. Sales Manager Dept. Store ( Shoes, Handbag &amp; Accecoris ). ( kode : SHOES) min 3 tahun di Dept. Store<br>4. Sales Manager Dept. Store ( Man, Ladies &amp; Children ) ( kode : MAN ) min 3 tahun di Dept. Store<br>5. Sales Manager Dept. Store ( C &amp; F ) ( kode : COSMETIC) min 3 tahun di Dept. Store<br>6. Team Leader Dept. Store ( Shoes, Handbag &amp; Accecoris ). (Kode: TLSHOES) min 2 tahun di Dept. Store<br>7. Team Leader Dept. Store ( Man, Ladies &amp; Children ) ( kode: TLMAN) min 2 tahun.di Dept. Store<br>8. Team Leader Dept. Store ( C &amp; F ) ( Kode : TLCOSMETIC) min 2 tahun di Dept. Store<br>9. Sales Associate Dept. Store ( Shoes, Handbag &amp; Accecoris ) (kode: SASHOES) min 1 tahun di Dept. Store<br>10. Sales Associate Dept. Store ( Man, Ladies &amp; Children ) ( kode : SAMAN) min 1 tahun di. Dept. Store<br>11. Sales Associate Dept. Store ( C &amp; F ) ( kode: SACOSMETIC) min 1 tahun di Dept. Store<br>12. Chef pengalaman di Restaurant/Hotel 3-5 tahun (Kode:CHEF)<br>13. Baker pengalaman di Restarant/Hotel 3-5 tahun (kode:BAKER)<br>14. Barista pengalaman di Restaurant/Hotel 3-5 tahun (kode: BARISTA)</p><p>Penempatan pada Gerai</p><p>1. Surabaya<br>2. Bandung<br>3. Padang<br>4. Depok<br>5. Yogyakarta<br>6. Manado <br>7. Tegal<br>8. Mataram <br>9. Pekan Baru<br>10. Semarang<br>11. Jakarta<br>12. Palembang<br>13. Karawang</p><p>Persyaratan umum</p><p>No. 1 sd 5<br>- Pria/Wanita, max 30 tahun<br>- Minimum S1 segala jurusan<br>- Jujur, Tegas, Teliti dan Bertanggung jawab<br>- Dapat bekerja sama dalam tim<br>- berpengalaman di dept. store <br>- diutamakan dept. store dari :<br>Sogo, Metro, Lotus, Centro, Matahari, Ramayana, Ria Busana dan Sejenisnya</p><p>No. 6 sd 11<br>- Pria/Wanita, max 25 tahun<br>- Minimum SLTA segala jurusan<br>- Jujur, Tegas, Teliti dan Bertanggung jawab<br>- Dapat bekerja sama dalam tim<br>- berpengalaman di dept. store min 1 tahun<br>- diutamakan dept. store dari :<br>Sogo, Metro, Lotus, Centro, Matahari, Ramayana, Ria Busana dan Sejenisnya</p><p>No. 12 sd 14<br>- Pria / Wanita, Max 35 tahun<br>- Minimum S1 Perhotelan / Pariwisata / Tataboga<br>- Jujur, Tegas, teliti &amp; bertanggung jawab<br>- Dapat bekerja sama dalam tim<br>- berpengalaman di Hotel / Restaurant 3-5 tahun</p><p>Bagi yg berminat &amp; memenuhi syarat &amp; kualifikasi, silahkan kirimkan CV dan Surat Lamaran beserta Lampiran Ijazah terakhir &amp; surat pengalaman kerja sesuai persyaratan diatas ke alamat email kami :<br>SUMARNI_SURMARNI@TRANSRETAIL.CO.ID<br>Sumarni_surmarni@transretail.co.id</p><p>Dengan mencantumkan KODE yang dipilih pada subject email.<br>Contoh:<br>1. DEPUTY Karawang exp SOGO 5 tahun<br>2. TLSHOES Manado exp METRO 2 tahun<br>3. CHEF Surabaya exp Hotel 4 tahun</p><p>Mohon bantuannya untuk share, barangkali ada keluarga atau kerabat yang membutuhkan pekerjaan &amp; memenuhi kualifikasi di atas.<br>Terima kasih.</p><p></p><br>\r\n\r\n<br><p></p>', '2016-12-20', '10,11', 1, 'Admin', '07:04:50', 'assets/images/berita/5.jpg'),
(15, 'Informasi Prakerin Kelas XI', '<p>\r\n\r\n</p><p>Gelombang I</p><p>Praktek Kerja Lapangan (PKL) gelombang I mulai tanggal 24 oktober 2016 s.d. 23 Januari 2017 untuk paket keahlian Teknik Audio Video (TAV), TIPTL, Teknik Pemesinan (TPM),Teknik Pengelasan (TPL), Teknik Kendaraan Ringan (TKR), Teknik Komputer Jaringan (TKJ), Rekayasa Perangkat Lunak (RPL).</p><p>&nbsp;</p><p>Gelombang II</p><p>Rencana tanggal 9 Januari 2017 s.d. 8 April 2017 , untuk Paket keahlian : Teknik Gambar Bangunan(TGB), Teknik Otomasi Industri (TOI), Teknik Elektro Industri (TEI), Seni Karawitan (SK).</p>\r\n\r\n<br><p></p>', '2016-12-20', '9,12', 17, 'Admin', '07:06:34', 'assets/images/berita/7.jpg'),
(16, 'LKBB3 untuk Tingkat SMA/SMK sederajat', '<p>\r\n\r\nhari kedua LKBB untuk tingkat SMA/SMK sederajat berjalan dengan lancar, meskipun di tengah-tengah acara ada hujan, namun para siswa dan siswi tetap menampilka performa terbaiknya untuk meraih kemenangan di LKBB yang di laksanakan di SMKN 1 sumedang.\r\n\r\n<br></p>', '2016-12-20', '9,13,11', 0, 'Admin', '07:08:24', 'assets/images/berita/8.jpg'),
(17, 'Juara LKBB 3 tingkat SMP Se- Jawa Barat', '<p>\r\n\r\n</p><p>Juara LKBB tingkat SMP sejawa barat sebagai Juara Umum LKBB, the best performance, &nbsp;diraih oleh SMPN 3 BAYONGBONG. ini lah uraian juara tingkat SMP:</p><p><strong>Juara Kostum Terbaik </strong></p><p>1. SMPN 3 Cileunyi B</p><p>2. SMPN 1 Situraja</p><p>3. SMPN 3 Bayongbong </p><p><strong>&nbsp;</strong></p><p><strong>Juara Daton Terbaik </strong></p><p>1. SMPN 1 Cimalaka</p><p>2. SMPN 3 Bayongbong</p><p>3. SMPN 4 Sumedang</p><p>&nbsp;</p><p><strong>Juara Pareasi Terbaik</strong></p><p>1. SMPN 1 Cimalaka</p><p>2. SMPN 1 Garut</p><p>3. SMPN 1 Sumedang A</p><p>&nbsp;</p><p><strong>Juara PBB Terbaik</strong></p><p>1. SMPN 3 Bayongbong</p><p>2. SMPN 5 Sumedang</p><p>3. SMPN 1 Situraja</p><p>&nbsp;</p><p><strong>Juara Purwa Terbaik</strong></p><p>1. SMPN 3 Cileunyi</p><p>2. SMPN 3 Sumedang B</p><p>3. SMP 3 Cimalaka</p><p>&nbsp;</p><p><strong>Juara Mula Terbaik</strong></p><p>1. SMPN 3 Sumedang A</p><p>2. SMPN 6 Sumedang</p><p>3. SMPN 5 Sumedang B</p><p>&nbsp;</p><p><strong>Juara Bina Terbaik</strong></p><p>1. SMPN 2 Cimalaka</p><p>2. SMPN 6 Cikarang Utara</p><p>3. SMPN 1 Cileunyi</p><p>&nbsp;</p><p><strong>Juara Madya Terbaik</strong></p><p>1. SMPN 4 Sumedang</p><p>2. SMPN 9 Sumedang</p><p>3.</p><p>&nbsp;</p><p><strong>Juara Harapan </strong></p><p>1. SMPN 1 Situraja</p><p>2. SMPN 1 Garut</p><p>3. SMPN 1 Cisitu</p><p>&nbsp;</p><p><strong>Juara Utama </strong></p><p>1. SMPN 1 Cimalaka</p><p>2. SMPN 5 Sumedang B</p><p>3. SMPN 3 Bayongbong</p><p>&nbsp;</p><p><strong>The best Performance :</strong>&nbsp;SMPN 3 Bayongbong</p><p><strong>Juara Umum :</strong>&nbsp;SMPN 3 Bayongbong</p>\r\n\r\n<br><p></p>', '2016-12-20', '9,13,11', 0, 'Admin', '07:09:14', 'assets/images/berita/9.jpg'),
(18, 'PMR SMKN 1 Sumedang Juara Umum Lomba Antariksa sejawabarat', '<p>\r\n\r\nPMR SMKN 1 sumedang menjadi Juara Umum Lomba Antariksa PMR Se - Jawa Barat &nbsp;yang di selenggarakan di yang diselenggarakan di SMAN 24 Bandung.. \r\n\r\n<br></p>', '2016-12-20', '9,13', 1, 'Admin', '07:09:46', 'assets/images/berita/10.jpg');
