INSERT INTO `jurusan` (`id`, `kode`, `nama`, `logo`, `visi`, `misi`, `kompetensi`, `fasilitas`, `img`, `struktur`, `icon`) VALUES
(1, 'rpl', 'Rekayasa Perangkat Lunak', 'rpl/logo.png', 'Mencetak tenaga profesional di bidang Rekayasa Perangkat Lunak dalam menghadapi MEA ( Masyarakat Ekonomi Asean ) pada tahun 2017', 'Menyelenggarakan pendidikan paket keahlian Rekayasa Perangkat Lunak untuk menghasilkan lulusan yang kompeten|Menghasilkan tamatan yang memiliki kompetensi tinggi dan terampil dalam bidang paket keahlian rekayasa perangkat lunak serta berwawasan global dan bertaqwa kepada tuhan yang maha esa', 'Mengoperasikan Peripheral|Modul 4 Mengoperasikan perangkat lunak Pengolah Kata|mengoperasikan Perangkat Lunak Lembar Sebar|Mengoperasikan Perangkat Lunak Presentasi|Mengoperasikan Perangkat Lunak Basis Data|Melakukan Koneksi Internet dan Bekerja Dengan Int|Mengelola Informasi|Merakit Personal Komputer|Melakukan Instalasi Sistem Operasi Dasar|Menerapkan Keselamatan Kesehatan Kerja dan Lingkungan Hidup|Melakukan instalasi sistem operasi GUI dan CLI|Melakukan Instalasi Software|Merancang web database untuk kontent server1', 'lab komputer|perpustakaan|mesjid|wifi|laptop|simulasi jaringan|lab komputer2|server', 'rpl/img.jpg', 'rpl/struktur.png', 'komputer'),
(2, 'karawitan', 'Seni Karawitan', 'karawitan/logo.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Seni Karawitan.', 'Menyelenggarakan pendidikan kompetensi keahlian Seni Karawitan untuk menghasilkan lulusan yang kompeten.|Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', '', '', '', 'karawitan/struktur.png', 'karawitan'),
(3, 'tav', 'Teknik Audio Video', 'tav/logo.png', 'Menjadi penyelenggara pendidikan profesional yang unggul dalam kompetensi keahlian Teknik Audio Video', 'Menyelenggarakan pendidikan kompetensi keahlian Teknik Audio Video untuk menghasilkan lulusan yang kompeten.|Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', 'Perakitan Amplifier|Perakitan TV, VCD, DVD|Perakitan Monitor Komputer', 'Laboratorium Elektronika Komunikasi|Laboratorium Komputer', 'tav/img.jpg', 'tav/struktur.png', 'elektro'),
(4, 'tei', 'Teknik Elektro Industri', 'tei/logo.png', 'Menjadi penyelenggara pendidikan profesional yang unggul dalam kompetensi keahlian Teknik Elektro Industri', 'Menyelenggarakan pendidikan kompetensi keahlian Teknik Elektro Industri untuk menghasilkan lulusan yang kompeten.|Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', 'Perakitan Amplifier|Perakitan TV, VCD, DVD|Perakitan Monitor Komputer', 'Laboratorium Elektronika Komunikasi|Laboratorium Komputer', 'tei/img.jpg', 'tei/struktur.png', 'elektro'),
(5, 'tgb', 'Teknik Gambar Bangunan', 'tgb/logo.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Gambar Bangunan.', 'Menyelenggarakan pendidikan kompetensi keahlian Teknik Gambar Bangunan untuk menghasilkan lulusan yang kompeten.|Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', 'Dapat mendesign sebuah rancang bangunan. baik secara visualisi 2D atau 3D.|Dapat Merancang gambar dan arsitektur bangunan dengan menggunakan autocad.|Mempunyai produk unggulan dari hasil design rancang bangunanan untuk nantinya di pasarkan.', 'Laboratorium Komputer Auto-Cad|Studio Gambar', 'tgb/img.jpg', 'tgb/struktur.png', 'bangunan'),
(6, 'tiptl', 'Teknik Instalasi Pemanfaatan Tenaga Listrik', 'tiptl/logo.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Instalasi pemanfaatan Tenaga Listrik.', 'Menyelenggarakan pendidikan kompetensi keahlian Teknik Instalasi pemanfaatan Tenaga Listrik untuk menghasilkan lulusan yang kompeten.|Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.|Mengembangkan suasana PBM yang memungkinkan terjadinya produktivitas dan kualitas kerja yang tinggi.', 'Transformator|PLC', 'Laboratorium Komputer Auto-Cad|Laboratorium Kelistrikan', 'tiptl/img.jpg', 'tiptl/struktur.png', 'listrik'),
(7, 'tkr', 'Teknik Kendaraan Ringan', 'tkr/logo.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Kendaraan Ringan', 'Menyelenggarakan pendidikan kompetensi keahlian Teknik Kendaraan Ringan untuk menghasilkan lulusan yang kompeten.|Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', 'Cat dan Body kendaraan|Emisi kendaraan|Tune Up Kendaraan', 'Lab. Motor(Engine)Mobil|Bengkel Praktek', 'tkr/img.jpg', 'tkr/struktur.png', 'otomotif'),
(8, 'tkj', 'Teknik Komputer Jaringan', 'tkj/logo.png', 'Mencetak tenaga profesional di bidang Teknik Komputer Jaringan (TKJ) dalam menghadapi MEA ( Masyarakat Ekonomi Asean ) pada tahun 2017', 'Menyelenggarakan pendidikan paket keahlian Teknik Komputer Jaringan untuk menghasilkan lulusan yang kompeten|Menghasilkan tamatan yang memiliki kompetensi tinggi dan terampil dalam bidang paket keahlian rekayasa perangkat lunak serta berwawasan global dan bertaqwa kepada tuhan yang maha esa', 'Mengoperasikan Peripheral|Modul 4 Mengoperasikan perangkat lunak Pengolah Kata|mengoperasikan Perangkat Lunak Lembar Sebar|Mengoperasikan Perangkat Lunak Presentasi|Mengoperasikan Perangkat Lunak Basis Data|Melakukan Koneksi Internet dan Bekerja Dengan Int|Mengelola Informasi|Merakit Personal Komputer|Melakukan Instalasi Sistem Operasi Dasar|Menerapkan Keselamatan Kesehatan Kerja dan Lingkungan Hidup|Menerapkan teknik elektronika analog dan digital dasar|Menerapkan fungsi peripheral dan instalasi PC|Mendiagnosis permasalahan pengoperasian PC dan periferal|Melakukan perbaikan dan atau setting ulang sistem PC|Melakukan perbaikan periferal|Melakukan perawatan PC|Melakukan instalasi sistem operasi GUI dan CLI|Melakukan Instalasi Software|Melakukan Instalasi Perangkat Jaringan LAN|Mendiagnosis Permasalahan Pengoperasian PC yg tersambung Jaringan|Melakukan Perbaikan dan atau Setting Ulang Koneksi Jaringan|Melakukan Instalasi Sistem Operasi Jaringan Berbasis GUI|Melakukan Instalasi Perangkat Jaringan Berbasis Luas (WAN)|Mendiagnosis Permasalahan Perangkat yang tersambung Jaringan (WAN)|Melakukan Perbaikan danatau Setting Ulang Koneksi Jaringan (WAN)|Menginstalasi Jaringan Tanpa Kabel (Wireless)|Instalasi Sistem Operasi Open Source|Menginstalasi dan Mengkonfigurasi Router|Membuat desain sistem keamanan jaringan|Mengadministrasi server dalam jaringan|Merancang bangun dan menganalisa WAN|Merancang web database untuk kontent server1', 'lab komputer|wifi|Notebook|simulasi jaringan|lab komputer2|server', 'tkj/img.jpg', 'tkj/struktur.png', 'komputer'),
(9, 'toi', 'Teknik Otomasi Industri', 'toi/logo.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Otomasi Industri.', 'Menyelenggarakan pendidikan kompetensi keahlian Teknik Otomasi Industri untuk menghasilkan lulusan yang kompeten.|Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.|Mengembangkan suasana PBM yang memungkinkan terjadinya produktivitas dan kualitas kerja yang tinggi.', 'Transformator|PLC', '', 'toi/img.jpg', 'toi/struktur.png', 'listrik'),
(10, 'tpm', 'Teknik Pemesinan', 'tpm/logo.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Pemesinan.', 'Menyelenggarakan pendidikan kompetensi keahlian Teknik Pemesinan untuk menghasilkan lulusan yang kompeten.|Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', 'Program CNC|Autocad mesin', 'Laboratorium Komputer Auto-Cad|Bengkel Praktek', 'tpm/img.jpg', 'tpm/struktur.png', 'mesin'),
(11, 'tpl', 'Teknik Pengelasan', 'tpl/logo.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Pengelasan.', 'Menyelenggarakan pendidikan kompetensi keahlian Teknik Pengelasanuntuk menghasilkan lulusan yang kompeten.\r|Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', 'a', 'a', 'tpl/img.jpg', 'tpl/struktur.png', 'mesin');
